(self.webpackChunkbugu=self.webpackChunkbugu||[]).push([[3662],{8894:(e,n,a)=>{"use strict";a.r(n),a.d(n,{data:()=>s});const s={key:"v-08982058",path:"/old_blog/oracle%E5%B8%B8%E7%94%A8%E5%91%BD%E4%BB%A4%E5%88%A0%E9%99%A4%E8%A1%A8%E6%95%B0%E6%8D%AE%E5%91%BD%E4%BB%A4.html",title:"删除表数据命令",lang:"zh-CN",frontmatter:{},excerpt:"",headers:[{level:2,title:"truncate 命令",slug:"truncate-命令",children:[]},{level:2,title:"delete命令",slug:"delete命令",children:[]},{level:2,title:"drop命令",slug:"drop命令",children:[]}],filePathRelative:"old_blog/oracle常用命令删除表数据命令.md",git:{updatedTime:1597237797e3}}},1038:(e,n,a)=>{"use strict";a.r(n),a.d(n,{default:()=>l});const s=(0,a(6252).uE)('<h1 id="删除表数据命令"><a class="header-anchor" href="#删除表数据命令">#</a> 删除表数据命令</h1><h2 id="truncate-命令"><a class="header-anchor" href="#truncate-命令">#</a> truncate 命令</h2><p><code>truncate table 表名；</code></p><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>例如：删除客户信息表\ntruncate  table customerInfoTable；\n\n注意：\n    1.用truncate删除表数据，只是删除表中的数据，表结构不会被删除！\n\n    2.删除整个表的数据时,过程是系统一次性删除数据,效率比较高\n\n    3.truncate删除释放空间\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br></div></div><h2 id="delete命令"><a class="header-anchor" href="#delete命令">#</a> delete命令</h2><p><code>delete table 表名；</code></p><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>例如：删除用户信息表\ndelete table customerInfoTable；\n\n注意：\n    1.用delete删除表数据，只是删除表中的数据，表结构不会被删除！\n\n    2.虽然也是删除整个表的数据,但是过程是系统一行一行地删,效率比truncate低\n\n    3.delete删除是不释放空间的\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br></div></div><h2 id="drop命令"><a class="header-anchor" href="#drop命令">#</a> drop命令</h2><p><code>drop table 表名；</code></p><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>例如：删除用户信息表\ndrop table  customerInfoTable；\n\n注意：\n    1.用drop删除表数据，不但会删除表中的数据，连表结构也被删除了！\n \n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br></div></div><p>另外可以阅读：https://www.cr173.com/html/40708_1.html 。</p>',11),l={render:function(e,n){return s}}}}]);